import styled from "styled-components";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faInstagram,
  faTwitterSquare,
  faMediumM,
} from "@fortawesome/free-brands-svg-icons";

const Contact = () => {
  return (
    <Container>
      <FontAwesomeIcon
        icon={faInstagram}
        size="2xl"
        color="aliceblue"
        aria-hidden="true"
      />
      <FontAwesomeIcon
        icon={faTwitterSquare}
        size="2xl"
        color="aliceblue"
        aria-hidden="true"
      />
      <FontAwesomeIcon
        icon={faMediumM}
        size="2xl"
        color="aliceblue"
        aria-hidden="true"
      />
    </Container>
  );
};

export default Contact;

const Container = styled.div`
  border: 5px solid skyblue;
  border-radius: 50px;
  box-shadow: 20px 20px black;
  display: flex;
  justify-content: space-evenly;
  min-height: 1000px;
  min-width: 1000px;
  max-width: 50%;
`;
